如果不存在最后一个单词，请返回 0 。
说明：一个单词是指由字母组成，但不包含任何空格的字符串。
示例:
输入: "Hello World"
输出: 5
解答
/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLastWord = function(s) {
    var index = s.length -1;
    while (s[index] === ' ') index -= 1;
    s = s.slice(0, index + 1);
    while (s[index] && s[index] !== ' ') index -= 1;
    return s.length - 1 - index;
};

QA/PlusOne.html.body:
加一
问题
给定一个由整数组成的非空数组所表示的非负整数，在该数的基础上加一。
最高位数字存放在数组的首位， 数组中每个元素只存储一个数字。
你可以假设除了整数 0 之外，这个整数不会以零开头。
示例 1:
输入: [1,2,3]
输出: [1,2,4]
解释: 输入数组表示数字 123。
示例 2:
输入: [4,3,2,1]
输出: [4,3,2,2]
解释: 输入数组表示数字 4321。
解答
/**
 * @param {number[]} digits
 * @return {number[]}
 */
var plusOne = function(digits) {
    var carry = 1, index = digits.length - 1;
    while (index >= 0) {
        digits[index] += carry;
        carry = parseInt(digits[index] / 10);
        digits[index] %= 10;
        index -= 1;
    }
    return carry ? [carry].concat(digits) : digits;
};

QA/AddBinary.html.body:
二进制求和
问题
实现 strStr() 函数。
给定一个 haystack 字符串和一个 needle 字符串，在 haystack 字符串中找出 needle 字符串出现的第一个位置 (从0开始)。如果不存在，则返回  -1。
示例 1:
输入: haystack = "hello", needle = "ll"
输出: 2
示例 2:
输入: haystack = "aaaaa", needle = "bba"
输出: -1
说明:
当 needle 是空字符串时，我们应当返回什么值呢？这是一个在面试中很好的问题。
对于本题而言，当 needle 是空字符串时我们应当返回 0 。这与C语言的 strstr() 以及 Java的 indexOf() 定义相符。
解答
/**
 * @param {string} a
 * @param {string} b
 * @return {string}
 */
var addBinary = function(a, b) {
    var i = a.length - 1, j = b.length - 1, index = 0, arr = [], carry = 0;
    while ((i >= 0) || (j >= 0) || carry) {
        arr[index] = (Number(a[i]) || 0) + (Number(b[j]) || 0) + carry;
        carry = parseInt(arr[index] / 2);
        arr[index] = arr[index] % 2;
        index += 1;
        j -= 1;
        i -= 1;
    }
    return arr.reverse().join('');
};

QA/RemoveDuplicatesfromSortedList.html.body:
删除排序链表中的重复元素
问题
给定一个排序链表，删除所有重复的元素，使得每个元素只出现一次。
示例 1:
输入: 1->1->2
输出: 1->2
示例 2:
输入: 1->1->2->3->3
输出: 1->2->3
解答
/**
 * Definition for singly-linked list.
 * function ListNode(val) {
 *     this.val = val;
 *     this.next = null;
 * }
 */
/**
 * @param {ListNode} head
 * @return {ListNode}
 */
var deleteDuplicates = function(head) {
    if (!head) return head;
    var n1 = head;
    for (var n2 = head.next; n2; n2 = n2.next ) {
        if (n2.val !== n1.val) {
            n1.next = n2;
            n1 = n1.next;
        }
    }
    n1.next = null;
    return head;
};

QA/MergeSortedArray.html.body:
合并两个有序数组
问题
给定两个有序整数数组 nums1 和 nums2，将 nums2 合并到 nums1 中，使得 num1 成为一个有序数组。
说明:
初始化 nums1 和 nums2 的元素数量分别为 m 和 n。
你可以假设 nums1 有足够的空间（空间大小大于或等于 m + n）来保存 nums2 中的元素。
示例:
输入:
nums1 = [1,2,3,0,0,0], m = 3
nums2 = [2,5,6],       n = 3

输出: [1,2,2,3,5,6]
解答
/**
 * @param {number[]} nums1
 * @param {number} m
 * @param {number[]} nums2
 * @param {number} n
 * @return {void} Do not return anything, modify nums1 in-place instead.
 */
var merge = function(nums1, m, nums2, n) {
    var k = m + n, i = m - 1, j = n - 1;
    while (k--) {
        if (isNaN(nums2[j])) break;
        if (nums1[i] >= nums2[j]) {
            nums1[k] = nums1[i];
            i -= 1;
        } else {
            nums1[k] = nums2[j];
            j -= 1;
        }
    }
    return nums1;
};

