    if (!head || !head.next) return head;
    var stack = [], node = head, left;
    while (node) {
        left = node.next;
        node.next = null;
        stack.push(node);
        node = left;
    }
    for (var i = stack.length -1; i >= 0; i -= 1) {
        stack[i].next = stack[i - 1] || null;
    }
    return stack.pop();
