解法一：
function search(node, res) {
    if (!node) return;
    var lnode = search(node.left, res), rnode = search(node.right, res);
    res.min = Math.min(
        res.min,
        lnode ? node.val - lnode.e : Infinity,
        rnode ? rnode.s - node.val : Infinity
    );
