输出: 5
原因: 最长的和谐数组是：[3,2,2,2,3].
说明: 输入的数组长度最大不超过20,000.
解答
/**
 * @param {number[]} nums
 * @return {number}
 */
// 结果序列的最后一位的前面序列一定在它之前
// 可使用一个map保存每个数字的个数
var findLHS = function(nums) {
    const numTimes = {}
    let maxLen = 0
    for (let num of nums) {
        numTimes[num] = (numTimes[num] || 0) + 1
        maxLen = Math.max(
            maxLen,
            numTimes[num - 1] ? numTimes[num - 1] + numTimes[num] : 0,
            numTimes[num + 1] ? numTimes[num + 1] + numTimes[num] : 0
        )
    }
    return maxLen
};

