解答
/**
 * @param {number} k
 * @param {number[]} nums
 */
// 先对数组进行排序，调用add进行插入排序
// 也可二分查找到需要插入对位置，然后对数组分割
var KthLargest = function(k, nums) {
    this.k = k
    this.nums = nums.sort((a, b) => b - a)
};

/**
 * @param {number} val
 * @return {number}
