//   01110 2比特
//  011110 1比特...
//  111110 2/1比特...
// 转为数0前连续1的奇偶，1为奇数则是2比特，偶数1比特
var isOneBitCharacter = function(bits) {
    let cnt = 0
    for (let i = bits.length - 2; i >= 0; i -= 1) {
