 * @param {number[]} A
 * @return {number}
 */
// 转为寻找有重复的元素
var repeatedNTimes = function(A) {
    const set = new Set()
    for (let num of A) {
        if (set.has(num)) return num
        set.add(num)
    }
};

QA/UnivaluedBinaryTree.html.body:
单值二叉树
问题
如果二叉树每个节点都具有相同的值，那么该二叉树就是单值二叉树。
只有给定的树是单值二叉树时，才返回 true；否则返回 false。
示例 1：

输入：[1,1,1,1,1,null,1]
输出：true
示例 2：

输入：[2,2,2,5,2]
输出：false
提示：

给定树的节点数范围是 [1, 100]。
每个节点的值都是整数，范围为 [0, 99] 。

解答
/**
 * Definition for a binary tree node.
 * function TreeNode(val) {
 *     this.val = val;
 *     this.left = this.right = null;
 * }
 */
/**
 * @param {TreeNode} root
 * @return {boolean}
 */
var isUnivalTree = function(root) {
    const val = root.val
    function traverse(node, val) {
        if (!node) return true
        if (node.val === val) {
            return traverse(node.left, val) && traverse(node.right, val)
        }
        return false
    }
    return traverse(root.left, root.val) && traverse(root.right, root.val)
};

QA/SquaresofaSortedArray.html.body:
有序数组的平方
问题
给定一个按非递减顺序排序的整数数组 A，返回每个数字的平方组成的新数组，要求也按非递减顺序排序。
示例 1：
输入：[-4,-1,0,3,10]
输出：[0,1,9,16,100]
示例 2：
输入：[-7,-3,2,3,11]
输出：[4,9,9,49,121]
提示：

1 
-10000 
A 已按非递减顺序排序。

解答
/**
 * @param {number[]} A
 * @return {number[]}
 */
// 负数组从大到小，正数组从小到大
// 两个指针分别指向正负数组头尾
var sortedSquares = function(A) {
    const res = [], sn = [], sp = []
    for (let num of A) num = 0) {
        if (sp[i]  sn[j]) {
            res.push(sn[j])
            j -= 1
        } else {
            res.push(sp[i] || sn[j])
            i += 1
            j -= 1
        }
    }
    return res
};
